import React from 'react';
import { Image } from 'react-bootstrap';

interface ArtistItemProps {
  name: string;
  imageUrl: string;
}

const MobileTopArtists: React.FC<ArtistItemProps> = ({ name, imageUrl }) => {
  return (
    <div className="text-center">
      <Image src={imageUrl} roundedCircle fluid className="mb-2" />
      <p>{name}</p>
    </div>
  );
};

export default MobileTopArtists;
